// TimeSlotModal.js
import React from 'react';
import Modal from 'react-modal';

const TimeSlotModal = ({ isOpen, onRequestClose, contentLabel, children }) => {
  return (
    <Modal
      isOpen={isOpen}
      onRequestClose={onRequestClose}
      contentLabel={contentLabel}
    >
      {children}
    </Modal>
  );
};

export default TimeSlotModal;
